	"\u53ef\u80fd\u56e0\u70ba\u4f5c\u54c1\u4e0b\u8f09\u76ee\u9304\u6539\u8b8a\u4e86\uff0c\u800c\u5feb\u53d6\u8cc7\u6599\u6307\u5411\u4e0d\u5b58\u5728\u7684\u820a\u4f4d\u7f6e\u3002": "Isso pode ocorrer porque o diret\u00f3rio de download do trabalho foi alterado e os dados do cache apontam para o local antigo que n\u00e3o existe.",
	"\u53ef\u80fd\u56e0\u70ba\u4f5c\u54c1\u8cc7\u8a0a\u5feb\u53d6\u8207\u7576\u524d\u7db2\u7ad9\u4e0a\u4e4b\u4f5c\u54c1\u7ae0\u7bc0\u7d50\u69cb\u4e0d\u540c\u3002": "Isso pode ocorrer porque o cache de informa\u00e7\u00f5es de trabalho \u00e9 diferente da estrutura do cap\u00edtulo de trabalho no site atual.",
	"\u82e5\u60a8\u4e4b\u524d\u66fe\u7d93\u4e0b\u8f09\u904e\u672c\u4f5c\u54c1\u7684\u8a71\uff0c\u8acb\u5c01\u5b58\u539f\u6709\u4f5c\u54c1\u76ee\u9304\uff0c\u6216\u5c07\u4f5c\u54c1\u8cc7\u8a0a\u5feb\u53d6\u6a94\uff08\u4f5c\u54c1\u76ee\u9304\u4e0b\u7684 \u4f5c\u54c1id.json\uff09\u6539\u540d\u4e4b\u5f8c\u5617\u8a66\u5168\u65b0\u4e0b\u8f09\u3002": "Se voc\u00ea j\u00e1 baixou esse trabalho antes, salve o cat\u00e1logo original do trabalho ou renomeie o arquivo de cache do trabalho (o id.json do trabalho no diret\u00f3rio do trabalho) e tente fazer o novo download.",
	"\u5b58\u5728\u8f03\u5927\u7684\u820a\u6a94 (%2)\uff0c\u5c07\u4e0d\u8986\u84cb\uff1a%1": "H\u00e1 um arquivo antigo grande (%2) que n\u00e3o ser\u00e1 substitu\u00eddo: %1",
