	"work_crawler-skip-image-error-prompt": "Voc\u00ea pode definir MIN_LENGTH. Por exemplo, MIN_LENGTH=%1 significa permitir uma imagem com um m\u00ednimo de %1 bytes; ou definir skip_error=true para ignorar o erro de imagem. Depois que o arquivo for obtido, altere voc\u00ea mesmo o nome do arquivo e remova o sufixo %2 do nome do arquivo de erro para ignorar esse erro.",
