	"\u82e5\u932f\u8aa4\u6301\u7e8c\u767c\u751f\uff0c\u60a8\u53ef\u4ee5\u8a2d\u5b9a skip_error=true \u4f86\u5ffd\u7565\u5716\u7247\u932f\u8aa4\u3002": "Se o erro persistir, voc\u00ea pode definir skip_error=true para ignorar o erro da imagem.",
	"\u60a8\u5fc5\u9808\u8a2d\u5b9a skip_error \u6216 allow_EOI_error \u9078\u9805\uff0c\u624d\u6703\u5132\u5b58\u640d\u58de\u7684\u6a94\u6848\u3002": "Voc\u00ea deve definir a op\u00e7\u00e3o skip_error ou allow_EOI_error para armazenar arquivos corrompidos.",
	"\u82e5\u60a8\u9700\u8981\u91cd\u65b0\u4e0b\u8f09\u4e4b\u524d\u4e0b\u8f09\u5931\u6557\u7684\u7ae0\u7bc0\uff0c\u8acb\u958b\u555f recheck \u9078\u9805\u3002": "Se for necess\u00e1rio baixar novamente a se\u00e7\u00e3o que n\u00e3o foi baixada anteriormente, ative a op\u00e7\u00e3o de nova verifica\u00e7\u00e3o.",
