	"\u9084\u6709%1\u5f35{{PLURAL:%1|\u95b1\u8b80\u5377}}\uff0c\u4e14\u7b2c %2/%3 \u7ae0\u9084\u6709\u6c92\u4e0b\u8f09\u904e\uff0c\u5f9e\u6b64\u7ae0\u958b\u59cb\u6aa2\u67e5\u3002": "Ainda h\u00e1 %1 {{PLURAL:%1|ticket|tickets}} lendo, mas o %2/%3 cap\u00edtulo ainda n\u00e3o foi baixado. Portanto, verifique a partir deste cap\u00edtulo.",
	"\u5df2\u8cfc\u8cb7\u7ae0\u7bc0\u300a%1\u300b\u3002": "\u00ab%1\u00bb foi comprado.",
