	"\u672c\u7ae0\u7bc0\u72c0\u6cc1\u4e0d\u660e(%1)\u3002\u8df3\u904e\u300a%1\u300b\u4e0d\u63a1\u7528\u95b1\u8b80\u5377\u3002": "O status desse cap\u00edtulo \u00e9 desconhecido (%1). Ignorar \"%1\" n\u00e3o usa volumes de leitura.",
	"\u672a\u8a2d\u5b9a\u8b93\u672c\u5de5\u5177\u81ea\u52d5\u4f7f\u7528\u95b1\u8b80\u5377\u3002\u82e5\u60a8\u4e26\u975e\u4f7f\u7528\u5b89\u88dd\u5305\uff0c\u4e26\u60f3\u8981\u8b93\u672c\u5de5\u5177\u81ea\u52d5\u4f7f\u7528\u95b1\u8b80\u5377\uff0c\u8acb\u6253\u958b\u6a94\u6848\u7e3d\u7ba1\uff0c\u5230\u5b89\u88dd\u672c\u5de5\u5177\u7684\u76ee\u9304\u4e0b\uff08\u82e5\u662f\u60a8\u4f7f\u7528\u5b89\u88dd\u5305\uff0c\u5c31\u4e0d\u80fd\u5920\u8a2d\u5b9a\u5e33\u865f\u5bc6\u78bc\u4e86\u3002\uff09\uff0c\u5728\u300cwork_crawler.configuration.js\u300d\u9019\u500b .js \u7d44\u614b\u6a94\u6848\u4e2d\u8a2d\u5b9a\u597d\u5e33\u865f\u5bc6\u78bc\u8cc7\u6599\uff0c\u4e26\u8a2d\u5b9a\u300cauto_use_ticket:true\u300d\u3002\u60a8\u53ef\u4ee5\u53c3\u8003 work_crawler.default_configuration.js \u9019\u500b\u6a94\u6848\u4f86\u505a\u8a2d\u5b9a\u3002": "A ferramenta n\u00e3o est\u00e1 configurada para usar automaticamente o volume de leitura. Se voc\u00ea n\u00e3o estiver usando o pacote de instala\u00e7\u00e3o e quiser que a ferramenta use automaticamente o volume de leitura, abra o gerenciador de arquivos e v\u00e1 para o diret\u00f3rio em que a ferramenta est\u00e1 instalada (se voc\u00ea usar o pacote de instala\u00e7\u00e3o, n\u00e3o poder\u00e1 definir a senha da conta). Defina as informa\u00e7\u00f5es da senha da conta no arquivo .js de configura\u00e7\u00e3o \"work_crawler.configuration.js\" e defina \"auto_use_ticket:true\". Voc\u00ea pode consultar o arquivo work_crawler.default_configuration.js para configura\u00e7\u00e3o.",
